import React from "react";

export const FormSection = () => {
  return (
    <section>
      <div>
        <form
          onSubmit={(e) => {
            e.preventDefault;
          }}
        >
          <h1>Send a wish</h1>
          <div>
            <input type="text" name="name" id="name" required />
            <input type="email" name="email" id="email" required />
          </div>
          <input type="text" name="message" id="message" required />
        </form>
      </div>
    </section>
  );
};
